import React from 'react'
import styles from '../styles/Ebook.scss'
const Ebook = () => {
    return (
        <div className={styles.EbookPageContainer}>
            <div className={styles.ImageContainer}></div>
            <div></div>
        </div>
    )
}

export default Ebook
